import '../styles/HeaderComponent.css';
import { MdMenu } from 'react-icons/md';
const HeaderComponent = ()=>{
    return(
        <header>
            <div className="container header-container">
                <h1>Adventure<span>Blog</span></h1>
                <MdMenu/>
                <ul id="desktop-menu">
                    <li>Home</li>
                    <li>About us</li>
                    <li>Contact us</li>
                </ul>
                <button>
                    Share your story
                </button>
            </div>
        </header>
    )
}

export default HeaderComponent;
